import React from 'react';
import './Login.css';
import { Row, Button, Jumbotron, Card, Accordion, Container, ListGroup, Form, Navbar, Nav, FormControl, Col, InputGroup } from 'react-bootstrap';

export default class Login{
    render(){
        return (
            <Jumbotron className="container-login">
                <Form ref="formLogin">
                    <Form.Group>
                        <Form.Label><p className="p-form">Nome</p></Form.Label>
                        <Form.Control type="text" name="nome" ref="nome" placeholder="Nome do aluno" required="required"></Form.Control>
                    </Form.Group>
                </Form>
            </Jumbotron>
        );
    }
}
